import Foundation

func makeEntry(serverAddress: String, serverName: String = "", status: ServerStatus) -> McServerStatusEntry {
    let configuration = ConfigurationIntent()
    configuration.serverAddress = serverAddress
    configuration.serverName = serverName

    return McServerStatusEntry(date: Date(), configuration: configuration, status: status)
}

